import React from "react";
import "./SignUpForm.css";
import logo from "../assets/logo-black.png";
import google from "../assets/google.png";
import Apple from "../assets/apple.png";
import {OverlayTrigger, Tooltip } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCircleInfo } from "@fortawesome/free-solid-svg-icons";
import { Link, useNavigate} from "react-router-dom";

const SignUpForm = () => {
    return(
        <div className="signup-box">
            <img src={logo} className="logo" alt ="logo"/>
            <h2>Sign Up to X</h2> 

            <OverlayTrigger
                placement="bottom"
                overlay={
                <Tooltip className="custom-tooltip" id="comming-soon">
                    <div>
                    <FontAwesomeIcon icon={faCircleInfo} />
                    {"   "}
                    <span>Comming soon!</span>
                    </div>
                </Tooltip>
                }
            >
                <button className="btn"><img src = {google} alt="" />Sign Up with Google</button>
            </OverlayTrigger>

            <OverlayTrigger
                placement="bottom"
                overlay={
                <Tooltip className="custom-tooltip" id="comming-soon">
                    <div>
                    <FontAwesomeIcon icon={faCircleInfo} />
                    {"   "}
                    <span>Comming soon!</span>
                    </div>
                </Tooltip>
                }
            >
                <button className="btn"><img src = {Apple} className="btn" alt="" />Sign Up with Apple</button>
            </OverlayTrigger>  
            
            <hr /><span>Or</span>

            <form action="post">
            <input type="text" placeholder="Name" name="name" required/>
                <input type="text" placeholder="Email" name="email" required/>
                <input type="text" placeholder="Username" name="username" required/>
                <input type="text" placeholder="Country" name="country" required/>
                <input type="text" placeholder="Phone Number" name="Phone number" required/>
                <input type="password" placeholder="Password" name="password" required/>
                <p className="photoName">Photo</p>
                <input type="file" placeholder="Photo" name="Photo" accept="image/*" />
                <button className="btn-next">Sign Up</button>
            </form>

            <p>Already have an account? <Link to="/signin">Sign in</Link></p>
        </div>
    );
};

export default SignUpForm;
